    </div>
  )
}




function Hero() {
  return (
    <>

     <section className="top-hero mt-4 md:mt-12">

      <h1 className="text-center pb-2">Tapnote</h1> 
      <h3 className="text-center pb-16 section-subhead">The reimagined Dental Record</h3>
      <section className="grid gap-5 grid-cols-1 pb-12 md:gap-10 md:grid-cols-10 md:pb-32">

         <p className="col-span-5 column max-w-lg">Fully indemnifiable notes for the ultimate defense against litigation in just seconds through patient-personalised suggestions that don't require a single keystroke.</p>

        <p className="col-span-5 column  max-w-lg">TapNote is an intelligent system that helps you get your <span className="highlight">notes done 80% faster with legal accuracy</span> while fully educating the patient.</p>

    </section>

    </section>

   </> 
  )
};


export default Hero;
